'use strict';

var events = require('./events');

function ExitCallEvent(btId, transactionGuid, startTime, endTime, backendState, backendId, callerChain, version) {
  this['event_type'] = events.EXIT_CALL_EVENT;
  this['bt_id'] = btId;
  this['transaction_guid'] = transactionGuid;
  this['start_time'] = startTime;
  this['end_time'] = endTime;
  this['backend_state'] = backendState;
  this['backend_id'] = backendId;
  this['caller_chain'] = callerChain;
  this['version'] = version;
}

exports.ExitCallEvent = ExitCallEvent;